ISLAMABAD, Sep 4 (APP):Muttahida Qaumi Movement (MQM) leaders Mustafa Kamal and Anis Qaimkhani called on Caretaker Prime Minister Anwaar-ul-Haq Kakar on Monday and discussed matters relating to mutual interests.
During the meeting, both leaders discussed the problems of Karachi with the prime minister and thanked him for taking steps to resolve those issues, a press release issued by the PM Office Media Wing said.
